import React from "react";

const conteudos = [
    {
      conteudo: 'High Order Functions',
      bloco: 8,
      status: 'Aprendido'
    },
    {
      conteudo: 'Composicao de Componentes',
      bloco: 11,
      status: 'Aprendendo',
    },
    {
      conteudo: 'Composicao de Estados',
      bloco: 12,
      status: 'Aprenderei'
    },
    {
      conteudo: 'Redux',
      bloco: 16,
      status: 'Aprenderei'
    },
  ];

const telaExport = conteudos.map((curr => {
    return {
        conteudo: curr.conteudo,
        Status: curr.status,
        Bloco: curr.bloco,
    }
}));  

class Component extends React.Component{
    render() {
       return (<span>{telaExport}</span>);
    };
}

export default Component;
